import React from 'react';

import { overlay } from './overlay';
import Alert from './alert';


export default class Modal extends React.Component {

  public unmountLogin: Function = null;

  public show() {
    this.unmountLogin = overlay.create(<Alert type="success">YEET</Alert>, {});
  }

  public hide() {
    this.unmountLogin();
  }
}
